import React from 'react';
import './app.css'

import AppHeader from '../app-header'
import FructList from '../fruct-list';

const App = () => {
  return (
    <div className="component-app">
      <AppHeader />

      <div>
        <div className="component-catalog">Catalog</div>
        <FructList />
      </div>

    </div>
  )
}

export default App;
